import Item from "./item";

const data = [{
    "deptno": "347",
    "deptname": "資工系"
},{
    "deptno": "348",
    "deptname": "電機系"
}]
const select = ({selectData}) => {
    return <div className="select">
        <select>
            {data.map((item) => {
                console.log(item);
                const {deptno, deptname} = item;
                return (
                    <Item
                        deptno={deptno}
                        deptname={deptname}
                    />
                );
            })
            }
        </select>
    </div>
}

export default select
